const initialState = {
	employee_next_id: 1,
	employees: [],
	dates: [],
}

const navigationReducer = (state = initialState, action) => {
	switch (action.type) {
		case 'UNDO': {
			return { ...state }
		}
		case 'REDO': {
			return { ...state }
		}
		default:
			return state;
	}
};

export default navigationReducer;
